var roomHtml = '';
var rooms = [];
 $('.room').each(function(){
   var features = [];
   $(this).find('.feature').each(function(){
     features.push($(this).text());
   });
   var room = {
     id : $(this).attr('id'),
     description: $(this).find('.description').html(),
     features:features
   };
	rooms.push(room);
});


return rooms;
